import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  Typography,
  Grid,
  Paper,
  Button,
  Select,
  MenuItem,
  TextField,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  IconButton,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

const Dashboard = ({ assets, indicators }) => {
  const [asset, setAsset] = useState('');
  const [marketDirection, setMarketDirection] = useState('');
  const [indicator1, setIndicator1] = useState('');
  const [indicator2, setIndicator2] = useState('');
  const [indicator3, setIndicator3] = useState('');
  const [entryPrice, setEntryPrice] = useState('');
  const [profitExit, setProfitExit] = useState('');
  const [stopLoss, setStopLoss] = useState('');
  const [trades, setTrades] = useState([]);

  // Fetch trades from the backend when the component mounts
  useEffect(() => {
    axios.get('http://localhost:5000/trades').then((response) => {
      setTrades(response.data);
    });
  }, []);

  const handleAssetChange = (e) => {
    const selectedAsset = e.target.value;
    setAsset(selectedAsset);
  };

  const handleSubmit = () => {
    const newTrade = {
      marketDirection,
      asset,
      indicators: [indicator1, indicator2, indicator3],
      entryPrice,
      profitExit,
      stopLoss,
    };

    // Save trade to the database
    axios.post('http://localhost:5000/trades', newTrade).then((response) => {
      setTrades([...trades, response.data]);
    });

    // Reset fields after submission
    setMarketDirection('');
    setAsset('');
    setIndicator1('');
    setIndicator2('');
    setIndicator3('');
    setEntryPrice('');
    setProfitExit('');
    setStopLoss('');
  };

  const handleDelete = (id) => {
    // Delete trade from the database
    axios.delete(`http://localhost:5000/trades/${id}`).then(() => {
      setTrades(trades.filter((trade) => trade._id !== id));
    });
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Dashboard
      </Typography>
      <Grid container spacing={3}>
        {/* Trade Logging Section */}
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: '16px' }}>
            <Typography variant="h6" gutterBottom>
              Log a Trade
            </Typography>

            {/* Step 1: Select Market Direction (Bullish/Bearish) */}
            <Typography>Select Market Direction:</Typography>
            <Select
              value={marketDirection}
              onChange={(e) => setMarketDirection(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              <MenuItem value="Bullish">Bullish</MenuItem>
              <MenuItem value="Bearish">Bearish</MenuItem>
            </Select>

            {/* Step 2: Select Asset */}
            <Typography>Select Asset:</Typography>
            <Select
              value={asset}
              onChange={handleAssetChange} // Handle asset change without fetching real-time prices
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              {assets.map((asset) => (
                <MenuItem key={asset.ticker} value={asset.name}>
                  {asset.name}
                </MenuItem>
              ))}
            </Select>

            {/* Step 3: Select First Confluence Indicator */}
            <Typography>Select First Confluence Indicator:</Typography>
            <Select
              value={indicator1}
              onChange={(e) => setIndicator1(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              {indicators.map((indicator) => (
                <MenuItem key={indicator._id} value={indicator.name}>
                  {indicator.name}
                </MenuItem>
              ))}
            </Select>

            {/* Step 4: Select Second Confluence Indicator */}
            <Typography>Select Second Confluence Indicator:</Typography>
            <Select
              value={indicator2}
              onChange={(e) => setIndicator2(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              {indicators.map((indicator) => (
                <MenuItem key={indicator._id} value={indicator.name}>
                  {indicator.name}
                </MenuItem>
              ))}
            </Select>

            {/* Step 5: Select Third Confluence Indicator */}
            <Typography>Select Third Confluence Indicator:</Typography>
            <Select
              value={indicator3}
              onChange={(e) => setIndicator3(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              {indicators.map((indicator) => (
                <MenuItem key={indicator._id} value={indicator.name}>
                  {indicator.name}
                </MenuItem>
              ))}
            </Select>

            {/* Step 6: Enter Trade Details */}
            <Typography>Entry Price:</Typography>
            <TextField
              value={entryPrice}
              onChange={(e) => setEntryPrice(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            />

            <Typography>Profit Exit:</Typography>
            <TextField
              value={profitExit}
              onChange={(e) => setProfitExit(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            />

            <Typography>Stop Loss:</Typography>
            <TextField
              value={stopLoss}
              onChange={(e) => setStopLoss(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            />

            {/* Submit Button */}
            <Button
              variant="contained"
              color="primary"
              onClick={handleSubmit}
              fullWidth
              style={{ marginTop: '16px' }}
            >
              Log Trade
            </Button>
          </Paper>
        </Grid>

        {/* Display Logged Trades */}
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: '16px' }}>
            <Typography variant="h6" gutterBottom>
              Logged Trades
            </Typography>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Market Direction</TableCell>
                  <TableCell>Asset</TableCell>
                  <TableCell>Indicators</TableCell>
                  <TableCell>Entry</TableCell>
                  <TableCell>Profit Exit</TableCell>
                  <TableCell>Stop Loss</TableCell>
                  <TableCell>Date Logged</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {trades.map((trade) => (
                  <TableRow key={trade._id}>
                    <TableCell>{trade.marketDirection}</TableCell>
                    <TableCell>{trade.asset}</TableCell>
                    <TableCell>
                      {trade.indicators.map((indicator, i) => (
                        <span key={i}>
                          {indicator.charAt(0).toUpperCase()}
                          {indicator.split(' ').map((word) => word.charAt(0)).join('')}{' '}
                        </span>
                      ))}
                    </TableCell>
                    <TableCell>${trade.entryPrice}</TableCell>
                    <TableCell>${trade.profitExit}</TableCell>
                    <TableCell>${trade.stopLoss}</TableCell>
                    <TableCell>{new Date(trade.loggedAt).toLocaleString()}</TableCell>
                    <TableCell>
                      <IconButton onClick={() => handleDelete(trade._id)} color="error">
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Dashboard;
